function addSubmissionNodeToList(a){addSubmissionToList(a);if(submissionIdsOnList.indexOf(a)<0){submissionIdsOnList.push(a)}}function generateSubmissionPopoverTitle(b){if(b.type==="solutionsubmission"){return null}else{var a="<button class='addButton close' title='Add to List' onclick=addSubmissionNodeToList("+b.id+")>+</button>";if(graphControls.anonymousGraph){return"<p><span class='header'>Student Id:</span>"+b.student.id+a+"</p>"}else{return"<p><span class='header'>Name:</span>"+b.student.display_name+a+"</p>"}}}function generateSubmissionPopoverContent(g){if(g.type==="solutionsubmission"){return"<h3 style='color:#CC0001;'>&nbsp;&nbsp;Solution Submission&nbsp;&nbsp;</h3>"}else{var b;var f;if(g.student.left_uiuc==="currently enrolled"){b=g.student.level_name+" ("+g.student.left_uiuc+")";f=g.student.program_name}else{b="Left UIUC "+g.student.left_uiuc;f="N/A"}var e="";for(var d in g.crossSemesterMatches){if(g.crossSemesterMatches.hasOwnProperty(d)){var a=g.crossSemesterMatches[d];var c=graphControls.minimumEdgeWeight<=(a.score1+a.score1)/2;if(c){e+="<a href='"+a.link+"' target='_blank'>View Moss Match Details</a><br/>"}}}if(e===""){e="None"}else{e=e.slice(0,e.length-5)}if(graphControls.anonymousGraph){return"<p><span class='header'>History Link:</span><br/><a class='post' target='_newtab' href='"+g.student.history_link+"'>View Student History</a></p><p><span class='header'>Cross Semester Matches:</span><br/><div class='post'>"+e+"</div></p>"}else{return"<p><span class='header'>Netid:</span>"+g.student.netid+"</p><p><span class='header'>Program:</span>"+f+"</p><p><span class='header'>Status:</span>"+b+"</p><p><span class='header'>History Link:</span><br/><a class='post' target='_newtab' href='"+g.student.history_link+"'>View Student History</a></p><p><span class='header'>Cross Semester Matches:</span><br/><div class='post'>"+e+"</div></p>"}}};